import React from "react";
import Axios from "axios";

export default class projectgrid extends React.Component{

    state = {
        projects: []
    }

    componentDidMount() {
        Axios.get("src/api/projects.json")
        .then(res => {
            console.log(res);
            this.setState({projects: res.data})
        })
    }

    render() {
        return (
            <ul>
                {this.state.projects.map(project => <li>{project.title}</li>)}
            </ul>
        )
    }
}
